import React from "react";
import ModeToggler from "./Mode Toggler";

import classes from './style.module.css'

const TopBar = (props) => {
    return (
        <div>
            <h1 className={props.darkMode ? classes.headingDark : classes.heading}>Web<span className={classes.highlight}>Scrapper</span></h1>
            <ModeToggler darkMode={props.darkMode} setDarkMode={props.setDarkMode}/>
        </div>
    )
}

export default TopBar
